My Friend's Hot Mom - Kendra Secrets 

Release Date: May 26, 2011

Kendra invites Chris over to discuss his relationship with her daughter. Kendra's upset that her daughter has changed her mind to stay in-state to go to college, despite her original dreams of going to New York. Chris admits that he really likes her daughter and probably had something to do with her not wanting to go away now. When he admits that sex is a big factor in it, Kendra shows him that her daughter doesn't need to be around for him to get laid.
